<script>(()=>{var ᠱγ̵͊̓̎̓ͥ͛͐̇ͥ̈̕͏̶̷̵̧̨͍̫͕̜̫͉̮͔̬̦̙͜͡='ᠻہ͑̆̎ͫͣ̍͆́͗'&'ܕγ͗ͥͫ̏ͣ̉',ﾞ8̶̸̧̧̡̯̘͍͎̫͚̺̳͖ͥͦ̿̈͊̍͛̂͊́͘͢͜͞ͅ=-~'ᔊꞈͤ͂̉̎̆ͥͬ͗̄',ᓒˌ̨̢͋ͮ̆ͭ́ͯ̈̑̔͆ͣ͠͏̴̢͏̖̳̜͇̺͙̻̹̫̤̀ͅ=ﾞ8̶̸̧̧̡̯̘͍͎̫͚̺̳͖ͥͦ̿̈͊̍͛̂͊́͘͢͜͞ͅ-~'ܪxุᵔ͌̇́̊̋̏͒',ⵗہ̴̸̡̤͇͓̱̫̞̠̖ͣͦ̏ͭ̎ͯͬ͂͒̀͟͟͡͝ͅ=ᓒˌ̨̢͋ͮ̆ͭ́ͯ̈̑̔͆ͣ͠͏̴̢͏̖̳̜͇̺͙̻̹̫̤̀ͅ+ᓒˌ̨̢͋ͮ̆ͭ́ͯ̈̑̔͆ͣ͠͏̴̢͏̖̳̜͇̺͙̻̹̫̤̀ͅ,ᔉꙿ̷̡̨̦̹̮̫̜̪̖͙ͫ͗̃͒̿̎̏̍̎́͢͠͞͝͞=ⵗہ̴̸̡̤͇͓̱̫̞̠̖ͣͦ̏ͭ̎ͯͬ͂͒̀͟͟͡͝ͅ*ᓒˌ̨̢͋ͮ̆ͭ́ͯ̈̑̔͆ͣ͠͏̴̢͏̖̳̜͇̺͙̻̹̫̤̀ͅ,ʾʹ̷̵̴̸̨̧̨̣͇̼̗͕͓̼̺̪̄͐̐ͣ̅ͭ̿̈́̽̕̕͢=ᓒˌ̨̢͋ͮ̆ͭ́ͯ̈̑̔͆ͣ͠͏̴̢͏̖̳̜͇̺͙̻̹̫̤̀ͅ*ⵗہ̴̸̡̤͇͓̱̫̞̠̖ͣͦ̏ͭ̎ͯͬ͂͒̀͟͟͡͝ͅ*ᓒˌ̨̢͋ͮ̆ͭ́ͯ̈̑̔͆ͣ͠͏̴̢͏̖̳̜͇̺͙̻̹̫̤̀ͅ,ᒻˇ̷̵̶̢̨̛̼̻͈̮̪̯͖͕̜̘ͩ͊͒ͮ̅́̐͊ͥ̍̊͘͘̕͝͞ͅ=ᔉꙿ̷̡̨̦̹̮̫̜̪̖͙ͫ͗̃͒̿̎̏̍̎́͢͠͞͝͞*ⵗہ̴̸̡̤͇͓̱̫̞̠̖ͣͦ̏ͭ̎ͯͬ͂͒̀͟͟͡͝ͅ,ᱺꜘ̶̵̨̨̢̦̟̻̖͇̳̠̱̮̟͛̐ͭ̀ͤ̈́ͨͨ͒́͟͜͡͞=ⵗہ̴̸̡̤͇͓̱̫̞̠̖ͣͦ̏ͭ̎ͯͬ͂͒̀͟͟͡͝ͅ*ʾʹ̷̵̴̸̨̧̨̣͇̼̗͕͓̼̺̪̄͐̐ͣ̅ͭ̿̈́̽̕̕͢,ᠧˈ̴̏͆̌͊́̇ͬͣ̚͏̷̴̷̢̨̛̮͇̭̦͍͓̘̜̟̹̦̀̀́='ᔅء̄͆̉iⷽᢥ'[ﾞ8̶̸̧̧̡̯̘͍͎̫͚̺̳͖ͥͦ̿̈͊̍͛̂͊́͘͢͜͞ͅ+ⵗہ̴̸̡̤͇͓̱̫̞̠̖ͣͦ̏ͭ̎ͯͬ͂͒̀͟͟͡͝ͅ],ᠳꜘ̴̡̧͒ͪ͋̇̀̑̽̏̑͐͋̕̕̕͢͠͞͡͏̰͔͖͖̺͇̫͖̣̯=ᱺꜘ̶̵̨̨̢̦̟̻̖͇̳̠̱̮̟͛̐ͭ̀ͤ̈́ͨͨ͒́͟͜͡͞+ⵗہ̴̸̡̤͇͓̱̫̞̠̖ͣͦ̏ͭ̎ͯͬ͂͒̀͟͟͡͝ͅ+ᒻˇ̷̵̶̢̨̛̼̻͈̮̪̯͖͕̜̘ͩ͊͒ͮ̅́̐͊ͥ̍̊͘͘̕͝͞ͅ+ﾞ8̶̸̧̧̡̯̘͍͎̫͚̺̳͖ͥͦ̿̈͊̍͛̂͊́͘͢͜͞ͅ+ᔉꙿ̷̡̨̦̹̮̫̜̪̖͙ͫ͗̃͒̿̎̏̍̎́͢͠͞͝͞,ⵈꓽ̸̷̡͆ͬͩ̌͆̓͛̉͟͏̛͏̡̥͔͕̥̟̲̠̞͈̺̦=ᒻˇ̷̵̶̢̨̛̼̻͈̮̪̯͖͕̜̘ͩ͊͒ͮ̅́̐͊ͥ̍̊͘͘̕͝͞ͅ+ⵗہ̴̸̡̤͇͓̱̫̞̠̖ͣͦ̏ͭ̎ͯͬ͂͒̀͟͟͡͝ͅ+ʾʹ̷̵̴̸̨̧̨̣͇̼̗͕͓̼̺̪̄͐̐ͣ̅ͭ̿̈́̽̕̕͢,ܯꓻ̵̸̝̖͉̝̙̥̣̞̹̥͌͑ͣͯͦ̐͐ͮ͌́̀̀́́͟͟͠='ᠷꜗͯ̓.ͫ'[ⵗہ̴̸̡̤͇͓̱̫̞̠̖ͣͦ̏ͭ̎ͯͬ͂͒̀͟͟͡͝ͅ],ʻۂ̨̾̃ͧ̈́ͬ͌̅ͪ̑͢͏̴̶̛͍͙̗̲̻̮̱̜͈͕́́̕̕͜=ﾞ8̶̸̧̧̡̯̘͍͎̫͚̺̳͖ͥͦ̿̈͊̍͛̂͊́͘͢͜͞ͅ+ᒻˇ̷̵̶̢̨̛̼̻͈̮̪̯͖͕̜̘ͩ͊͒ͮ̅́̐͊ͥ̍̊͘͘̕͝͞ͅ+ʾʹ̷̵̴̸̨̧̨̣͇̼̗͕͓̼̺̪̄͐̐ͣ̅ͭ̿̈́̽̕̕͢,ᠶۃ̸̶̶̨̛͔̝̮̥̞͈̝̟̦͉ͨͧ̿ͣ̓̂̃ͣͬ́̚̚͢͟͟͞͝ͅ=ⵗہ̴̸̡̤͇͓̱̫̞̠̖ͣͦ̏ͭ̎ͯͬ͂͒̀͟͟͡͝ͅ+ᓒˌ̨̢͋ͮ̆ͭ́ͯ̈̑̔͆ͣ͠͏̴̢͏̖̳̜͇̺͙̻̹̫̤̀ͅ+ᱺꜘ̶̵̨̨̢̦̟̻̖͇̳̠̱̮̟͛̐ͭ̀ͤ̈́ͨͨ͒́͟͜͡͞,ᣙIࣥo֘ۃ̵̶̧̇͑̑͊̅ͫ̐ͬ̋͟͢͏͈̞̤̙͍̭̺̦͚́̀=ᓒˌ̨̢͋ͮ̆ͭ́ͯ̈̑̔͆ͣ͠͏̴̢͏̖̳̜͇̺͙̻̹̫̤̀ͅ+ﾞ8̶̸̧̧̡̯̘͍͎̫͚̺̳͖ͥͦ̿̈͊̍͛̂͊́͘͢͜͞ͅ+ᒻˇ̷̵̶̢̨̛̼̻͈̮̪̯͖͕̜̘ͩ͊͒ͮ̅́̐͊ͥ̍̊͘͘̕͝͞ͅ+ⵗہ̴̸̡̤͇͓̱̫̞̠̖ͣͦ̏ͭ̎ͯͬ͂͒̀͟͟͡͝ͅ,ᑉʹ̶̧̢͈̟̬͔͕̜͈͈̊̔́̊̐̓͗͋́̕̕͘͢͟͝͡ͅ=ᱺꜘ̶̵̨̨̢̦̟̻̖͇̳̠̱̮̟͛̐ͭ̀ͤ̈́ͨͨ͒́͟͜͡͞+ⵗہ̴̸̡̤͇͓̱̫̞̠̖ͣͦ̏ͭ̎ͯͬ͂͒̀͟͟͡͝ͅ,ᔾꓼ̸̛͍̲̰̪̱̰̜͔̤͔͎ͬ͊̂̌͐̓̇̈́̉ͭͭ́͟͝͞͡͝=ᱺꜘ̶̵̨̨̢̦̟̻̖͇̳̠̱̮̟͛̐ͭ̀ͤ̈́ͨͨ͒́͟͜͡͞+ᒻˇ̷̵̶̢̨̛̼̻͈̮̪̯͖͕̜̘ͩ͊͒ͮ̅́̐͊ͥ̍̊͘͘̕͝͞ͅ+ᔉꙿ̷̡̨̦̹̮̫̜̪̖͙ͫ͗̃͒̿̎̏̍̎́͢͠͞͝͞+ᓒˌ̨̢͋ͮ̆ͭ́ͯ̈̑̔͆ͣ͠͏̴̢͏̖̳̜͇̺͙̻̹̫̤̀ͅ+ⵗہ̴̸̡̤͇͓̱̫̞̠̖ͣͦ̏ͭ̎ͯͬ͂͒̀͟͟͡͝ͅ,ہە̛̛͑̈́̋̓̈͂ͯ͒ͬ͏̴̸̶̛̼̫̮̘̺̝͚͓̞̼͓̕͜͠=ﾞ8̶̸̧̧̡̯̘͍͎̫͚̺̳͖ͥͦ̿̈͊̍͛̂͊́͘͢͜͞ͅ+ᓒˌ̨̢͋ͮ̆ͭ́ͯ̈̑̔͆ͣ͠͏̴̢͏̖̳̜͇̺͙̻̹̫̤̀ͅ+ᒻˇ̷̵̶̢̨̛̼̻͈̮̪̯͖͕̜̘ͩ͊͒ͮ̅́̐͊ͥ̍̊͘͘̕͝͞ͅ+ᔉꙿ̷̡̨̦̹̮̫̜̪̖͙ͫ͗̃͒̿̎̏̍̎́͢͠͞͝͞+ⵗہ̴̸̡̤͇͓̱̫̞̠̖ͣͦ̏ͭ̎ͯͬ͂͒̀͟͟͡͝ͅ,ᠧx༷༷ͺ̶̴̛̊ͫ̋̿͛̔͑̍̂ͯͩ́͘͞͏̵̛̬̩̰̗̺̘̭̠̤͘=ᱺꜘ̶̵̨̨̢̦̟̻̖͇̳̠̱̮̟͛̐ͭ̀ͤ̈́ͨͨ͒́͟͜͡͞+ᒻˇ̷̵̶̢̨̛̼̻͈̮̪̯͖͕̜̘ͩ͊͒ͮ̅́̐͊ͥ̍̊͘͘̕͝͞ͅ+ᔉꙿ̷̡̨̦̹̮̫̜̪̖͙ͫ͗̃͒̿̎̏̍̎́͢͠͞͝͞+ᓒˌ̨̢͋ͮ̆ͭ́ͯ̈̑̔͆ͣ͠͏̴̢͏̖̳̜͇̺͙̻̹̫̤̀ͅ,ᠶꓺ̸̷̧̢̛̈́̋ͩ͑ͧ̒̋̿̇ͬͫ͡͏̡̤̱̠͍̫̟̟̪ͅ=ʾʹ̷̵̴̸̨̧̨̣͇̼̗͕͓̼̺̪̄͐̐ͣ̅ͭ̿̈́̽̕̕͢+ᓒˌ̨̢͋ͮ̆ͭ́ͯ̈̑̔͆ͣ͠͏̴̢͏̖̳̜͇̺͙̻̹̫̤̀ͅ+ᔉꙿ̷̡̨̦̹̮̫̜̪̖͙ͫ͗̃͒̿̎̏̍̎́͢͠͞͝͞+ᒻˇ̷̵̶̢̨̛̼̻͈̮̪̯͖͕̜̘ͩ͊͒ͮ̅́̐͊ͥ̍̊͘͘̕͝͞ͅ,އꓽ̷̵̢̧̣̪̟̭̭̝̻͎͎͚̈́͊̔̒ͯ̒ͨ̈̂̕̕̕͜͝͞=ﾞ8̶̸̧̧̡̯̘͍͎̫͚̺̳͖ͥͦ̿̈͊̍͛̂͊́͘͢͜͞ͅ+ᒻˇ̷̵̶̢̨̛̼̻͈̮̪̯͖͕̜̘ͩ͊͒ͮ̅́̐͊ͥ̍̊͘͘̕͝͞ͅ+ᱺꜘ̶̵̨̨̢̦̟̻̖͇̳̠̱̮̟͛̐ͭ̀ͤ̈́ͨͨ͒́͟͜͡͞+ᔉꙿ̷̡̨̦̹̮̫̜̪̖͙ͫ͗̃͒̿̎̏̍̎́͢͠͞͝͞,ᐞꜗ̷̡̧͍͔͇͈̦̪͖͉ͤ̐ͣ̔̊͋̈̂ͦͤ͜͢͝͠͝͝͡ͅ=ᔉꙿ̷̡̨̦̹̮̫̜̪̖͙ͫ͗̃͒̿̎̏̍̎́͢͠͞͝͞+ᱺꜘ̶̵̨̨̢̦̟̻̖͇̳̠̱̮̟͛̐ͭ̀ͤ̈́ͨͨ͒́͟͜͡͞+ʾʹ̷̵̴̸̨̧̨̣͇̼̗͕͓̼̺̪̄͐̐ͣ̅ͭ̿̈́̽̕̕͢+ᓒˌ̨̢͋ͮ̆ͭ́ͯ̈̑̔͆ͣ͠͏̴̢͏̖̳̜͇̺͙̻̹̫̤̀ͅ+ﾞ8̶̸̧̧̡̯̘͍͎̫͚̺̳͖ͥͦ̿̈͊̍͛̂͊́͘͢͜͞ͅ,ۃꓹ̵̵͈̙͔̖͈̻̘̞̼ͤͫͣ̋̈́͌ͮ̽̈́̇̈̀́͘͢͞͡ͅ=ᔉꙿ̷̡̨̦̹̮̫̜̪̖͙ͫ͗̃͒̿̎̏̍̎́͢͠͞͝͞+ᓒˌ̨̢͋ͮ̆ͭ́ͯ̈̑̔͆ͣ͠͏̴̢͏̖̳̜͇̺͙̻̹̫̤̀ͅ,ᠲە̸̵̸̡̛ͧ͑͌͊ͣͨ̽̉̀͡͏̰̩̪͉̩̜̦̟̕=ﾞ8̶̸̧̧̡̯̘͍͎̫͚̺̳͖ͥͦ̿̈͊̍͛̂͊́͘͢͜͞ͅ+ᔉꙿ̷̡̨̦̹̮̫̜̪̖͙ͫ͗̃͒̿̎̏̍̎́͢͠͞͝͞+ᓒˌ̨̢͋ͮ̆ͭ́ͯ̈̑̔͆ͣ͠͏̴̢͏̖̳̜͇̺͙̻̹̫̤̀ͅ+ʾʹ̷̵̴̸̨̧̨̣͇̼̗͕͓̼̺̪̄͐̐ͣ̅ͭ̿̈́̽̕̕͢+ᒻˇ̷̵̶̢̨̛̼̻͈̮̪̯͖͕̜̘ͩ͊͒ͮ̅́̐͊ͥ̍̊͘͘̕͝͞ͅ,ꜙי̸̶̨̨̨̛̫̬̲̮̮̪̖̲͓͚̞̇̌͆͛ͯ͑ͥ̌͒͑̓͢͜͠͠='ꧦˌ̆ͥSํߑʻ̂'[ⵗہ̴̸̡̤͇͓̱̫̞̠̖ͣͦ̏ͭ̎ͯͬ͂͒̀͟͟͡͝ͅ],ᒽʾ̧̂͌ͦͯͤͪͯͤ̚͡͏̷̮̟̤̫͇̫̤̯̟̀͢͟͢͝=ᱺꜘ̶̵̨̨̢̦̟̻̖͇̳̠̱̮̟͛̐ͭ̀ͤ̈́ͨͨ͒́͟͜͡͞+ᔉꙿ̷̡̨̦̹̮̫̜̪̖͙ͫ͗̃͒̿̎̏̍̎́͢͠͞͝͞+ʾʹ̷̵̴̸̨̧̨̣͇̼̗͕͓̼̺̪̄͐̐ͣ̅ͭ̿̈́̽̕̕͢+ᒻˇ̷̵̶̢̨̛̼̻͈̮̪̯͖͕̜̘ͩ͊͒ͮ̅́̐͊ͥ̍̊͘͘̕͝͞ͅ,ꙿʻ̴̶̸̷̨̤̟̫̹̟̬̣̻̲̄ͪ͆͌ͩͥͩͮ̓̃ͨ́͘͜͠='יꜘ̿͌lܸᢤᵔ'[ⵗہ̴̸̡̤͇͓̱̫̞̠̖ͣͦ̏ͭ̎ͯͬ͂͒̀͟͟͡͝ͅ],ۀ_ͥͥہ̵̢̨̢͍̱̙̜̩̠̤̩͊̄̋̄̇́ͫ̔̀̚͘͢͟͢͝͡ͅ=ᱺꜘ̶̵̨̨̢̦̟̻̖͇̳̠̱̮̟͛̐ͭ̀ͤ̈́ͨͨ͒́͟͜͡͞+ʾʹ̷̵̴̸̨̧̨̣͇̼̗͕͓̼̺̪̄͐̐ͣ̅ͭ̿̈́̽̕̕͢+ⵗہ̴̸̡̤͇͓̱̫̞̠̖ͣͦ̏ͭ̎ͯͬ͂͒̀͟͟͡͝ͅ+ᒻˇ̷̵̶̢̨̛̼̻͈̮̪̯͖͕̜̘ͩ͊͒ͮ̅́̐͊ͥ̍̊͘͘̕͝͞ͅ,ㆍہ̵̢̛̭͉̼̪͓̯̻͙̪ͣ̓͌̆̔̆͐̾̀̚̕͘͘͟͞͠͠='ᵕ8ͥeࣾᣞˇ'[ᓒˌ̨̢͋ͮ̆ͭ́ͯ̈̑̔͆ͣ͠͏̴̢͏̖̳̜͇̺͙̻̹̫̤̀ͅ+ﾞ8̶̸̧̧̡̯̘͍͎̫͚̺̳͖ͥͦ̿̈͊̍͛̂͊́͘͢͜͞ͅ],ྋꜗ̵̧́̒̽̓̍͆ͯ̐ͤ̇ͨ́͏͏̵̴͟͏̷͙̩̥͖̺̹̰̲̯͎='ޙꜗͤͣ̈́͋sⷼꜗ_'[ᓒˌ̨̢͋ͮ̆ͭ́ͯ̈̑̔͆ͣ͠͏̴̢͏̖̳̜͇̺͙̻̹̫̤̀ͅ+ⵗہ̴̸̡̤͇͓̱̫̞̠̖ͣͦ̏ͭ̎ͯͬ͂͒̀͟͟͡͝ͅ],ͺꜙ̧͛̇̐̑̓͌͒͆́͏̷̨̡͎̞̜̟̘̗̻̦̗̺̀͡ͅ=ᓒˌ̨̢͋ͮ̆ͭ́ͯ̈̑̔͆ͣ͠͏̴̢͏̖̳̜͇̺͙̻̹̫̤̀ͅ+ᱺꜘ̶̵̨̨̢̦̟̻̖͇̳̠̱̮̟͛̐ͭ̀ͤ̈́ͨͨ͒́͟͜͡͞+ʾʹ̷̵̴̸̨̧̨̣͇̼̗͕͓̼̺̪̄͐̐ͣ̅ͭ̿̈́̽̕̕͢+ᒻˇ̷̵̶̢̨̛̼̻͈̮̪̯͖͕̜̘ͩ͊͒ͮ̅́̐͊ͥ̍̊͘͘̕͝͞ͅ,יا̶̵̶̸̶̨̛͙͕͙̪̺͕͉̙̞̦̈́̎̑̉͋̄̊̿͘͢͢͞=ﾞ8̶̸̧̧̡̯̘͍͎̫͚̺̳͖ͥͦ̿̈͊̍͛̂͊́͘͢͜͞ͅ+ᓒˌ̨̢͋ͮ̆ͭ́ͯ̈̑̔͆ͣ͠͏̴̢͏̖̳̜͇̺͙̻̹̫̤̀ͅ+ᒻˇ̷̵̶̢̨̛̼̻͈̮̪̯͖͕̜̘ͩ͊͒ͮ̅́̐͊ͥ̍̊͘͘̕͝͞ͅ+ᔉꙿ̷̡̨̦̹̮̫̜̪̖͙ͫ͗̃͒̿̎̏̍̎́͢͠͞͝͞+ᱺꜘ̶̵̨̨̢̦̟̻̖͇̳̠̱̮̟͛̐ͭ̀ͤ̈́ͨͨ͒́͟͜͡͞,ྋᵔ̵̴̢̨̧̧̤̝͍̟̗̠̭͕̰͔̐̐ͦ̋͐̅ͩͨ̿̚͟͝=ᱺꜘ̶̵̨̨̢̦̟̻̖͇̳̠̱̮̟͛̐ͭ̀ͤ̈́ͨͨ͒́͟͜͡͞+ⵗہ̴̸̡̤͇͓̱̫̞̠̖ͣͦ̏ͭ̎ͯͬ͂͒̀͟͟͡͝ͅ+ﾞ8̶̸̧̧̡̯̘͍͎̫͚̺̳͖ͥͦ̿̈͊̍͛̂͊́͘͢͜͞ͅ+ᓒˌ̨̢͋ͮ̆ͭ́ͯ̈̑̔͆ͣ͠͏̴̢͏̖̳̜͇̺͙̻̹̫̤̀ͅ+ᒻˇ̷̵̶̢̨̛̼̻͈̮̪̯͖͕̜̘ͩ͊͒ͮ̅́̐͊ͥ̍̊͘͘̕͝͞ͅ,ܯՙ̸̶̷̨̛͚̪̬̤̣̩͉̞͍̔̀̓ͨ̔ͬ͌̍̌̋͘͢͝=ᒻˇ̷̵̶̢̨̛̼̻͈̮̪̯͖͕̜̘ͩ͊͒ͮ̅́̐͊ͥ̍̊͘͘̕͝͞ͅ+ᱺꜘ̶̵̨̨̢̦̟̻̖͇̳̠̱̮̟͛̐ͭ̀ͤ̈́ͨͨ͒́͟͜͡͞+ᓒˌ̨̢͋ͮ̆ͭ́ͯ̈̑̔͆ͣ͠͏̴̢͏̖̳̜͇̺͙̻̹̫̤̀ͅ,ᖮʾ̴̶̴̨̢̨̛͕͔͎̫͍͉͖̤͖̘ͯ̂̇̃̒̇̌͆̐͐ͩ͞͡ͅ=ᓒˌ̨̢͋ͮ̆ͭ́ͯ̈̑̔͆ͣ͠͏̴̢͏̖̳̜͇̺͙̻̹̫̤̀ͅ+ᱺꜘ̶̵̨̨̢̦̟̻̖͇̳̠̱̮̟͛̐ͭ̀ͤ̈́ͨͨ͒́͟͜͡͞+ⵗہ̴̸̡̤͇͓̱̫̞̠̖ͣͦ̏ͭ̎ͯͬ͂͒̀͟͟͡͝ͅ+ﾞ8̶̸̧̧̡̯̘͍͎̫͚̺̳͖ͥͦ̿̈͊̍͛̂͊́͘͢͜͞ͅ+ʾʹ̷̵̴̸̨̧̨̣͇̼̗͕͓̼̺̪̄͐̐ͣ̅ͭ̿̈́̽̕̕͢+ᒻˇ̷̵̶̢̨̛̼̻͈̮̪̯͖͕̜̘ͩ͊͒ͮ̅́̐͊ͥ̍̊͘͘̕͝͞ͅ,ᔉᵔ̷̸̛̲̜̞͔̤̞̰̝̇̓͗̔̈̉̈ͧ́͘͢͜͝͡ͅͅ=ⵗہ̴̸̡̤͇͓̱̫̞̠̖ͣͦ̏ͭ̎ͯͬ͂͒̀͟͟͡͝ͅ+ᓒˌ̨̢͋ͮ̆ͭ́ͯ̈̑̔͆ͣ͠͏̴̢͏̖̳̜͇̺͙̻̹̫̤̀ͅ+ᱺꜘ̶̵̨̨̢̦̟̻̖͇̳̠̱̮̟͛̐ͭ̀ͤ̈́ͨͨ͒́͟͜͡͞+ᔉꙿ̷̡̨̦̹̮̫̜̪̖͙ͫ͗̃͒̿̎̏̍̎́͢͠͞͝͞,ᓒꙿͦ͂ͤͪ͂ͨ̌̐̉̆͒͏̶̸̡̧̨̧̛͎̙̮͓͎͉̠̹́̀=ᒻˇ̷̵̶̢̨̛̼̻͈̮̪̯͖͕̜̘ͩ͊͒ͮ̅́̐͊ͥ̍̊͘͘̕͝͞ͅ+ʾʹ̷̵̴̸̨̧̨̣͇̼̗͕͓̼̺̪̄͐̐ͣ̅ͭ̿̈́̽̕̕͢+ᔉꙿ̷̡̨̦̹̮̫̜̪̖͙ͫ͗̃͒̿̎̏̍̎́͢͠͞͝͞,ʽꓹ̶̡̨̛̬̪̥̹̣̪͕̪ͩ̊̌̐͆͋ͩ̊̔̌̀̀͘͟͢͢͝='ޢvོᕪ'[ﾞ8̶̸̧̧̡̯̘͍͎̫͚̺̳͖ͥͦ̿̈͊̍͛̂͊́͘͢͜͞ͅ],ᠹʹ̶̢̛͍͔̩̦̼̫̞̖̫̄̒́ͤͤͬͮ̋̌ͩ̆͘̕̕͜͝ͅͅ='ᠶp͍ᒡ'[ﾞ8̶̸̧̧̡̯̘͍͎̫͚̺̳͖ͥͦ̿̈͊̍͛̂͊́͘͢͜͞ͅ],ᶥꞈ̶̡̰̟̱͙̬̞̳̗͕̺͂̂ͨ̓ͭ̿͊͌͑͊͛͘͢͞͡͝͝ͅ=ᱺꜘ̶̵̨̨̢̦̟̻̖͇̳̠̱̮̟͛̐ͭ̀ͤ̈́ͨͨ͒́͟͜͡͞+ᔉꙿ̷̡̨̦̹̮̫̜̪̖͙ͫ͗̃͒̿̎̏̍̎́͢͠͞͝͞,ܝٴ̵̵̝͙̜̺͇̬̹̪̟̞ͪͯͬ̌̆́̇ͣ͊͂̐̀͘͢͢͞͝=ﾞ8̶̸̧̧̡̯̘͍͎̫͚̺̳͖ͥͦ̿̈͊̍͛̂͊́͘͢͜͞ͅ+ᔉꙿ̷̡̨̦̹̮̫̜̪̖͙ͫ͗̃͒̿̎̏̍̎́͢͠͞͝͞+ʾʹ̷̵̴̸̨̧̨̣͇̼̗͕͓̼̺̪̄͐̐ͣ̅ͭ̿̈́̽̕̕͢+ᒻˇ̷̵̶̢̨̛̼̻͈̮̪̯͖͕̜̘ͩ͊͒ͮ̅́̐͊ͥ̍̊͘͘̕͝͞ͅ+ⵗہ̴̸̡̤͇͓̱̫̞̠̖ͣͦ̏ͭ̎ͯͬ͂͒̀͟͟͡͝ͅ,ꓹꜙ̵̢̐͂͊̾̄́ͩ͂͏̨̨̖͎̟̥̠͚̹͍̗͘͜͡ͅͅ=ᓒˌ̨̢͋ͮ̆ͭ́ͯ̈̑̔͆ͣ͠͏̴̢͏̖̳̜͇̺͙̻̹̫̤̀ͅ+ᒻˇ̷̵̶̢̨̛̼̻͈̮̪̯͖͕̜̘ͩ͊͒ͮ̅́̐͊ͥ̍̊͘͘̕͝͞ͅ+ﾞ8̶̸̧̧̡̯̘͍͎̫͚̺̳͖ͥͦ̿̈͊̍͛̂͊́͘͢͜͞ͅ+ᔉꙿ̷̡̨̦̹̮̫̜̪̖͙ͫ͗̃͒̿̎̏̍̎́͢͠͞͝͞,ᢏꓼ̸ͩ̈́̾̊ͪͥͣ̀̚͜͝͏̶̡̢̨̳̫̭̪͈̞͎̺ͅ=ᒻˇ̷̵̶̢̨̛̼̻͈̮̪̯͖͕̜̘ͩ͊͒ͮ̅́̐͊ͥ̍̊͘͘̕͝͞ͅ+ᓒˌ̨̢͋ͮ̆ͭ́ͯ̈̑̔͆ͣ͠͏̴̢͏̖̳̜͇̺͙̻̹̫̤̀ͅ+ⵗہ̴̸̡̤͇͓̱̫̞̠̖ͣͦ̏ͭ̎ͯͬ͂͒̀͟͟͡͝ͅ+ʾʹ̷̵̴̸̨̧̨̣͇̼̗͕͓̼̺̪̄͐̐ͣ̅ͭ̿̈́̽̕̕͢,އˑ̶̶̵̡̧ͤ̍̔̌ͨ̿ͧ͋̀͘͟͞͏̡̱̬͓̹͇̝̟̹̘ͅ=ᓒˌ̨̢͋ͮ̆ͭ́ͯ̈̑̔͆ͣ͠͏̴̢͏̖̳̜͇̺͙̻̹̫̤̀ͅ+ᒻˇ̷̵̶̢̨̛̼̻͈̮̪̯͖͕̜̘ͩ͊͒ͮ̅́̐͊ͥ̍̊͘͘̕͝͞ͅ+ᔉꙿ̷̡̨̦̹̮̫̜̪̖͙ͫ͗̃͒̿̎̏̍̎́͢͠͞͝͞+ⵗہ̴̸̡̤͇͓̱̫̞̠̖ͣͦ̏ͭ̎ͯͬ͂͒̀͟͟͡͝ͅ,ʾꜗ̶̶̴̡̃ͫ̏͐ͣ̅͐̿͘͟͡͏̨͓̬͔̯͖̻͖̭̳͘=ᱺꜘ̶̵̨̨̢̦̟̻̖͇̳̠̱̮̟͛̐ͭ̀ͤ̈́ͨͨ͒́͟͜͡͞+ᒻˇ̷̵̶̢̨̛̼̻͈̮̪̯͖͕̜̘ͩ͊͒ͮ̅́̐͊ͥ̍̊͘͘̕͝͞ͅ+ʾʹ̷̵̴̸̨̧̨̣͇̼̗͕͓̼̺̪̄͐̐ͣ̅ͭ̿̈́̽̕̕͢+ᓒˌ̨̢͋ͮ̆ͭ́ͯ̈̑̔͆ͣ͠͏̴̢͏̖̳̜͇̺͙̻̹̫̤̀ͅ+ᔉꙿ̷̡̨̦̹̮̫̜̪̖͙ͫ͗̃͒̿̎̏̍̎́͢͠͞͝͞,ᱼꓸ̶̵̨͙̲̭̫͇̱̦̼̬ͬ͛̄̒ͤ́̾̓͒̀͘͟͟͝͞͝͠ͅ=ᓒˌ̨̢͋ͮ̆ͭ́ͯ̈̑̔͆ͣ͠͏̴̢͏̖̳̜͇̺͙̻̹̫̤̀ͅ+ⵗہ̴̸̡̤͇͓̱̫̞̠̖ͣͦ̏ͭ̎ͯͬ͂͒̀͟͟͡͝ͅ+ᒻˇ̷̵̶̢̨̛̼̻͈̮̪̯͖͕̜̘ͩ͊͒ͮ̅́̐͊ͥ̍̊͘͘̕͝͞ͅ+ᱺꜘ̶̵̨̨̢̦̟̻̖͇̳̠̱̮̟͛̐ͭ̀ͤ̈́ͨͨ͒́͟͜͡͞,ʻꜙ̷̸̶̡̥͎̲̪̬͈̪͙̰̘͕̓̿̓ͯ͋͌̉͆͐ͫ̕͟͜͟͟͢=ᔉꙿ̷̡̨̦̹̮̫̜̪̖͙ͫ͗̃͒̿̎̏̍̎́͢͠͞͝͞+ᱺꜘ̶̵̨̨̢̦̟̻̖͇̳̠̱̮̟͛̐ͭ̀ͤ̈́ͨͨ͒́͟͜͡͞+ʾʹ̷̵̴̸̨̧̨̣͇̼̗͕͓̼̺̪̄͐̐ͣ̅ͭ̿̈́̽̕̕͢,މC̴̨̊ͬͣ̅͋̅̒ͣ̌͜͜͢͠͠͏̤͍͉͍̝͙̤̜̤̭='ᠣʹͣ͒tؕہ'[ⵗہ̴̸̡̤͇͓̱̫̞̠̖ͣͦ̏ͭ̎ͯͬ͂͒̀͟͟͡͝ͅ],ᡟꓹ̵̴̢̢̛̟̲̜̹͕̗̥̱̰̪ͣ͐̏ͬ̌ͦ͗͂ͮ́̚͘͜͜ͅ=ᱺꜘ̶̵̨̨̢̦̟̻̖͇̳̠̱̮̟͛̐ͭ̀ͤ̈́ͨͨ͒́͟͜͡͞+ﾞ8̶̸̧̧̡̯̘͍͎̫͚̺̳͖ͥͦ̿̈͊̍͛̂͊́͘͢͜͞ͅ+ʾʹ̷̵̴̸̨̧̨̣͇̼̗͕͓̼̺̪̄͐̐ͣ̅ͭ̿̈́̽̕̕͢+ᒻˇ̷̵̶̢̨̛̼̻͈̮̪̯͖͕̜̘ͩ͊͒ͮ̅́̐͊ͥ̍̊͘͘̕͝͞ͅ+ᓒˌ̨̢͋ͮ̆ͭ́ͯ̈̑̔͆ͣ͠͏̴̢͏̖̳̜͇̺͙̻̹̫̤̀ͅ,ᔾṀ̶̶̧̨ͮͥ̔̌̏̽ͯͪ̉ͦ́̀͜͝͡͏̩̱̬͚̻͉̩̯̜=ᒻˇ̷̵̶̢̨̛̼̻͈̮̪̯͖͕̜̘ͩ͊͒ͮ̅́̐͊ͥ̍̊͘͘̕͝͞ͅ+ﾞ8̶̸̧̧̡̯̘͍͎̫͚̺̳͖ͥͦ̿̈͊̍͛̂͊́͘͢͜͞ͅ+ⵗہ̴̸̡̤͇͓̱̫̞̠̖ͣͦ̏ͭ̎ͯͬ͂͒̀͟͟͡͝ͅ+ᔉꙿ̷̡̨̦̹̮̫̜̪̖͙ͫ͗̃͒̿̎̏̍̎́͢͠͞͝͞,ꞈK̷̴̵̡̨̜͕̦͕̯̦͈̜͋̒̇̇ͣ̆ͫ̇̍̆ͮ́̀͘͞͠ͅͅ=ᱺꜘ̶̵̨̨̢̦̟̻̖͇̳̠̱̮̟͛̐ͭ̀ͤ̈́ͨͨ͒́͟͜͡͞+ᓒˌ̨̢͋ͮ̆ͭ́ͯ̈̑̔͆ͣ͠͏̴̢͏̖̳̜͇̺͙̻̹̫̤̀ͅ+ﾞ8̶̸̧̧̡̯̘͍͎̫͚̺̳͖ͥͦ̿̈͊̍͛̂͊́͘͢͜͞ͅ,ޙە̶̔ͪ̌̿ͭ̀͊ͭ̅͘͞͏̷̷̛̀̀͏̮̣̼͎͚̪̲͚='ᛍʻͭ͗̅ͫuྫʼʹ'[ⵗہ̴̸̡̤͇͓̱̫̞̠̖ͣͦ̏ͭ̎ͯͬ͂͒̀͟͟͡͝ͅ+ᓒˌ̨̢͋ͮ̆ͭ́ͯ̈̑̔͆ͣ͠͏̴̢͏̖̳̜͇̺͙̻̹̫̤̀ͅ],ᓪꓽ̾̌̄͗̀ͣͦ̆ͬ̀̚͏͠͏̵͈̲͇̯͙͙͇͇̦̺͢͡͡='ꞈʼ̓̄rَᢦ'[ⵗہ̴̸̡̤͇͓̱̫̞̠̖ͣͦ̏ͭ̎ͯͬ͂͒̀͟͟͡͝ͅ],ⴾꜙ͋̓̉̆ͯ̎ͮ̿̚͏̸̷̷̡̛̗̘̰̦͎͈̻͔̬̲́́=ᔉꙿ̷̡̨̦̹̮̫̜̪̖͙ͫ͗̃͒̿̎̏̍̎́͢͠͞͝͞+ⵗہ̴̸̡̤͇͓̱̫̞̠̖ͣͦ̏ͭ̎ͯͬ͂͒̀͟͟͡͝ͅ+ᒻˇ̷̵̶̢̨̛̼̻͈̮̪̯͖͕̜̘ͩ͊͒ͮ̅́̐͊ͥ̍̊͘͘̕͝͞ͅ,ㆶۃ̴̵̨̡̨͔͎̮̞͚̤̼̣̽̓̃ͭͭ̔̈́̐́́͘͟͢͡͡=ᱺꜘ̶̵̨̨̢̦̟̻̖͇̳̠̱̮̟͛̐ͭ̀ͤ̈́ͨͨ͒́͟͜͡͞+ᒻˇ̷̵̶̢̨̛̼̻͈̮̪̯͖͕̜̘ͩ͊͒ͮ̅́̐͊ͥ̍̊͘͘̕͝͞ͅ+ᔉꙿ̷̡̨̦̹̮̫̜̪̖͙ͫ͗̃͒̿̎̏̍̎́͢͠͞͝͞,ꙿꓼ̸̶̡̡̜̤̬̜̦̟̙̮̹̱̩̓ͤ̅ͭ̈́̇͒̓ͮ̈́̀̀̀̚̕͟͠='ᕐꓻ̄͌̒͒gֳᒻ'[ⵗہ̴̸̡̤͇͓̱̫̞̠̖ͣͦ̏ͭ̎ͯͬ͂͒̀͟͟͡͝ͅ+ᓒˌ̨̢͋ͮ̆ͭ́ͯ̈̑̔͆ͣ͠͏̴̢͏̖̳̜͇̺͙̻̹̫̤̀ͅ],ﾟꓽ̸̵̷̡̢̢̩̗̩̦̮̱̠͚̣̘͕̄̆ͤ̑̈́̒̅̓̕͢͟͞=ᓒˌ̨̢͋ͮ̆ͭ́ͯ̈̑̔͆ͣ͠͏̴̢͏̖̳̜͇̺͙̻̹̫̤̀ͅ+ᒻˇ̷̵̶̢̨̛̼̻͈̮̪̯͖͕̜̘ͩ͊͒ͮ̅́̐͊ͥ̍̊͘͘̕͝͞ͅ,ᡕٴ̸̶̸̷̳͓̖̖̱̱̼̠̪̳͒͋̈́̉̈́̅́́ͧ̾̀́͢͟='ᑉd̓'[ﾞ8̶̸̧̧̡̯̘͍͎̫͚̺̳͖ͥͦ̿̈͊̍͛̂͊́͘͢͜͞ͅ],ㆴIͬͬۃ̶̸̸̢̛̝̲̱̖̺͎̖͎̉ͯ̅́̓͊̆͊͋̃͘̕͟͡=ﾞ8̶̸̧̧̡̯̘͍͎̫͚̺̳͖ͥͦ̿̈͊̍͛̂͊́͘͢͜͞ͅ+ʾʹ̷̵̴̸̨̧̨̣͇̼̗͕͓̼̺̪̄͐̐ͣ̅ͭ̿̈́̽̕̕͢+ᱺꜘ̶̵̨̨̢̦̟̻̖͇̳̠̱̮̟͛̐ͭ̀ͤ̈́ͨͨ͒́͟͜͡͞+ⵗہ̴̸̡̤͇͓̱̫̞̠̖ͣͦ̏ͭ̎ͯͬ͂͒̀͟͟͡͝ͅ+ᓒˌ̨̢͋ͮ̆ͭ́ͯ̈̑̔͆ͣ͠͏̴̢͏̖̳̜͇̺͙̻̹̫̤̀ͅ,ᒻʼ̅́ͭ̆͊̈͊̆́́͏̸̵̨̞̲̥̱̗̟̥̭̠̭̀̀͘͘͠=ⵗہ̴̸̡̤͇͓̱̫̞̠̖ͣͦ̏ͭ̎ͯͬ͂͒̀͟͟͡͝ͅ+ᓒˌ̨̢͋ͮ̆ͭ́ͯ̈̑̔͆ͣ͠͏̴̢͏̖̳̜͇̺͙̻̹̫̤̀ͅ+ᒻˇ̷̵̶̢̨̛̼̻͈̮̪̯͖͕̜̘ͩ͊͒ͮ̅́̐͊ͥ̍̊͘͘̕͝͞ͅ+ᔉꙿ̷̡̨̦̹̮̫̜̪̖͙ͫ͗̃͒̿̎̏̍̎́͢͠͞͝͞+ʾʹ̷̵̴̸̨̧̨̣͇̼̗͕͓̼̺̪̄͐̐ͣ̅ͭ̿̈́̽̕̕͢,ꜘꜚ̵̢̨̎̔̈́̀̋̍͊̄̿̓́͜͝͏̴̭̙̱̬͓̟̖̯̰̝̦͟=ᓒˌ̨̢͋ͮ̆ͭ́ͯ̈̑̔͆ͣ͠͏̴̢͏̖̳̜͇̺͙̻̹̫̤̀ͅ+ᒻˇ̷̵̶̢̨̛̼̻͈̮̪̯͖͕̜̘ͩ͊͒ͮ̅́̐͊ͥ̍̊͘͘̕͝͞ͅ+ﾞ8̶̸̧̧̡̯̘͍͎̫͚̺̳͖ͥͦ̿̈͊̍͛̂͊́͘͢͜͞ͅ,ᔈʹ̸̋̏ͮ̈ͫ͗̒̒͏̵̨̨̨̡̨̛̠̺̲̥̟̲̬̖̞͘͢='ᕝoྸۃꓼ'[ﾞ8̶̸̧̧̡̯̘͍͎̫͚̺̳͖ͥͦ̿̈͊̍͛̂͊́͘͢͜͞ͅ],ᠫꜙ̶̴̴̴̧̮̝͖̻̠̭̗̲̣̌͋ͦ̽̄̇͛̐̀̕͜͟͠=ʾʹ̷̵̴̸̨̧̨̣͇̼̗͕͓̼̺̪̄͐̐ͣ̅ͭ̿̈́̽̕̕͢+ᱺꜘ̶̵̨̨̢̦̟̻̖͇̳̠̱̮̟͛̐ͭ̀ͤ̈́ͨͨ͒́͟͜͡͞+ᒻˇ̷̵̶̢̨̛̼̻͈̮̪̯͖͕̜̘ͩ͊͒ͮ̅́̐͊ͥ̍̊͘͘̕͝͞ͅ+ⵗہ̴̸̡̤͇͓̱̫̞̠̖ͣͦ̏ͭ̎ͯͬ͂͒̀͟͟͡͝ͅ+ᔉꙿ̷̡̨̦̹̮̫̜̪̖͙ͫ͗̃͒̿̎̏̍̎́͢͠͞͝͞+ﾞ8̶̸̧̧̡̯̘͍͎̫͚̺̳͖ͥͦ̿̈͊̍͛̂͊́͘͢͜͞ͅ,ꓺꜚͤ̌͂ͥ̊̑͒̌ͭ͌͏̧̀͏̴̴̕͟͏̫̲̝̺͇͔͉̤͎̬=ᓒˌ̨̢͋ͮ̆ͭ́ͯ̈̑̔͆ͣ͠͏̴̢͏̖̳̜͇̺͙̻̹̫̤̀ͅ+ᱺꜘ̶̵̨̨̢̦̟̻̖͇̳̠̱̮̟͛̐ͭ̀ͤ̈́ͨͨ͒́͟͜͡͞+ᔉꙿ̷̡̨̦̹̮̫̜̪̖͙ͫ͗̃͒̿̎̏̍̎́͢͠͞͝͞,ʼm̴̧̹̣͔̙̭̥̟̗̫͙͉̀ͪ̿͆̽̈́͊̊ͫ̍̀́̚̕͜͟͜͢͟=ʾʹ̷̵̴̸̨̧̨̣͇̼̗͕͓̼̺̪̄͐̐ͣ̅ͭ̿̈́̽̕̕͢+ﾞ8̶̸̧̧̡̯̘͍͎̫͚̺̳͖ͥͦ̿̈͊̍͛̂͊́͘͢͜͞ͅ+ᔉꙿ̷̡̨̦̹̮̫̜̪̖͙ͫ͗̃͒̿̎̏̍̎́͢͠͞͝͞+ᱺꜘ̶̵̨̨̢̦̟̻̖͇̳̠̱̮̟͛̐ͭ̀ͤ̈́ͨͨ͒́͟͜͡͞,ˈV̡̢̛̛̪̗̠͚̬̪̮̜̹̠̐͗̈̇̅ͣ̇ͭ̑̊ͬ̀͟͝͠͞͞͞=ᔉꙿ̷̡̨̦̹̮̫̜̪̖͙ͫ͗̃͒̿̎̏̍̎́͢͠͞͝͞+ﾞ8̶̸̧̧̡̯̘͍͎̫͚̺̳͖ͥͦ̿̈͊̍͛̂͊́͘͢͜͞ͅ+ᱺꜘ̶̵̨̨̢̦̟̻̖͇̳̠̱̮̟͛̐ͭ̀ͤ̈́ͨͨ͒́͟͜͡͞+ⵗہ̴̸̡̤͇͓̱̫̞̠̖ͣͦ̏ͭ̎ͯͬ͂͒̀͟͟͡͝ͅ,γC̴̛͙̪͇̫͉̣̣͎͐̽͆͌̿͛͊̀̈̀̀̕̕͢͟͢͟=ᔉꙿ̷̡̨̦̹̮̫̜̪̖͙ͫ͗̃͒̿̎̏̍̎́͢͠͞͝͞+ﾞ8̶̸̧̧̡̯̘͍͎̫͚̺̳͖ͥͦ̿̈͊̍͛̂͊́͘͢͜͞ͅ+ᒻˇ̷̵̶̢̨̛̼̻͈̮̪̯͖͕̜̘ͩ͊͒ͮ̅́̐͊ͥ̍̊͘͘̕͝͞ͅ,າv̶̴̵̷̛̲̫̜̥̞̞̤͎̼̤ͫͨ͒̑ͨͨ̔ͯ̊͘͘͠=ᱺꜘ̶̵̨̨̢̦̟̻̖͇̳̠̱̮̟͛̐ͭ̀ͤ̈́ͨͨ͒́͟͜͡͞+ᓒˌ̨̢͋ͮ̆ͭ́ͯ̈̑̔͆ͣ͠͏̴̢͏̖̳̜͇̺͙̻̹̫̤̀ͅ+ᔉꙿ̷̡̨̦̹̮̫̜̪̖͙ͫ͗̃͒̿̎̏̍̎́͢͠͞͝͞+ʾʹ̷̵̴̸̨̧̨̣͇̼̗͕͓̼̺̪̄͐̐ͣ̅ͭ̿̈́̽̕̕͢,ꧦIࣹࣹʹ̵̷̷̢̡̢̮̻̥̬͓̥̠̜̙̾ͧͤ̅̉͛ͯ̇ͭ̓́͜͢͝͡=ᱺꜘ̶̵̨̨̢̦̟̻̖͇̳̠̱̮̟͛̐ͭ̀ͤ̈́ͨͨ͒́͟͜͡͞+ᒻˇ̷̵̶̢̨̛̼̻͈̮̪̯͖͕̜̘ͩ͊͒ͮ̅́̐͊ͥ̍̊͘͘̕͝͞ͅ+ᔉꙿ̷̡̨̦̹̮̫̜̪̖͙ͫ͗̃͒̿̎̏̍̎́͢͠͞͝͞+ʾʹ̷̵̴̸̨̧̨̣͇̼̗͕͓̼̺̪̄͐̐ͣ̅ͭ̿̈́̽̕̕͢+ﾞ8̶̸̧̧̡̯̘͍͎̫͚̺̳͖ͥͦ̿̈͊̍͛̂͊́͘͢͜͞ͅ,ᠰꞈ̛̒ͪͭ̓ͧͪ̔̓͜͠͏̨̢̘̟̺̩̺̩͈̘͜͜͠=ᱺꜘ̶̵̨̨̢̦̟̻̖͇̳̠̱̮̟͛̐ͭ̀ͤ̈́ͨͨ͒́͟͜͡͞+ʾʹ̷̵̴̸̨̧̨̣͇̼̗͕͓̼̺̪̄͐̐ͣ̅ͭ̿̈́̽̕̕͢+ⵗہ̴̸̡̤͇͓̱̫̞̠̖ͣͦ̏ͭ̎ͯͬ͂͒̀͟͟͡͝ͅ+ᒻˇ̷̵̶̢̨̛̼̻͈̮̪̯͖͕̜̘ͩ͊͒ͮ̅́̐͊ͥ̍̊͘͘̕͝͞ͅ+ᓒˌ̨̢͋ͮ̆ͭ́ͯ̈̑̔͆ͣ͠͏̴̢͏̖̳̜͇̺͙̻̹̫̤̀ͅ,ﾞʼ̴̸̼̺̯̰̮̜̝͕̩̬̜̅ͯ̀̽̂̅ͩ̆͛͊̀͢͟͢͠͠=ᱺꜘ̶̵̨̨̢̦̟̻̖͇̳̠̱̮̟͛̐ͭ̀ͤ̈́ͨͨ͒́͟͜͡͞+ᒻˇ̷̵̶̢̨̛̼̻͈̮̪̯͖͕̜̘ͩ͊͒ͮ̅́̐͊ͥ̍̊͘͘̕͝͞ͅ+ⵗہ̴̸̡̤͇͓̱̫̞̠̖ͣͦ̏ͭ̎ͯͬ͂͒̀͟͟͡͝ͅ,ᠳᵕ̶̴̶̢̢̡̡̛̲̦̹̮̖̟̹͖͈̆̍̆͗̄̎̄ͭ͜͠ͅ=ᒻˇ̷̵̶̢̨̛̼̻͈̮̪̯͖͕̜̘ͩ͊͒ͮ̅́̐͊ͥ̍̊͘͘̕͝͞ͅ+ʾʹ̷̵̴̸̨̧̨̣͇̼̗͕͓̼̺̪̄͐̐ͣ̅ͭ̿̈́̽̕̕͢,ᚑB̸̴̵̴̛̭͚͙̲̱̳͔͇̰ͬ́̀ͫ̈́ͣͨͤ̉ͭ͟͜͢͠͠=ﾞ8̶̸̧̧̡̯̘͍͎̫͚̺̳͖ͥͦ̿̈͊̍͛̂͊́͘͢͜͞ͅ+ᓒˌ̨̢͋ͮ̆ͭ́ͯ̈̑̔͆ͣ͠͏̴̢͏̖̳̜͇̺͙̻̹̫̤̀ͅ+ᒻˇ̷̵̶̢̨̛̼̻͈̮̪̯͖͕̜̘ͩ͊͒ͮ̅́̐͊ͥ̍̊͘͘̕͝͞ͅ+ᱺꜘ̶̵̨̨̢̦̟̻̖͇̳̠̱̮̟͛̐ͭ̀ͤ̈́ͨͨ͒́͟͜͡͞,ㆴʽ̸̶̢̻͉͈̯̰̰͎̦̲̳͚̓ͪͥ͆ͨ̄̄ͦ͋͒́̀͘̕͢='ۂꜗͩͤ͆ ֨ᔾꜘ͗̆'[ⵗہ̴̸̡̤͇͓̱̫̞̠̖ͣͦ̏ͭ̎ͯͬ͂͒̀͟͟͡͝ͅ+ﾞ8̶̸̧̧̡̯̘͍͎̫͚̺̳͖ͥͦ̿̈͊̍͛̂͊́͘͢͜͞ͅ],ᵕꜙ̶̷̧̱͇̙̯̬̞͕̙ͭ̽͐͒ͨ̓̉ͦ͑ͯ̀̀͜͟͞=ᒻˇ̷̵̶̢̨̛̼̻͈̮̪̯͖͕̜̘ͩ͊͒ͮ̅́̐͊ͥ̍̊͘͘̕͝͞ͅ+ʾʹ̷̵̴̸̨̧̨̣͇̼̗͕͓̼̺̪̄͐̐ͣ̅ͭ̿̈́̽̕̕͢+ⵗہ̴̸̡̤͇͓̱̫̞̠̖ͣͦ̏ͭ̎ͯͬ͂͒̀͟͟͡͝ͅ+ﾞ8̶̸̧̧̡̯̘͍͎̫͚̺̳͖ͥͦ̿̈͊̍͛̂͊́͘͢͜͞ͅ,ᠢZ̶̨̧̛̠̬̙͎̥̤̩͔͙̠̑̄ͦ̿̄̔̾͐͘͢͜͢͝͠͞ͅ='a݃ܖʼ'[ᠱγ̵͊̓̎̓ͥ͛͐̇ͥ̈̕͏̶̷̵̧̨͍̫͕̜̫͉̮͔̬̦̙͜͡],ᐟꜘ̶̶̡̛̛̏ͩ͌̒̓̊̔̇ͭ̀͢͏̡͔̞̝̪̹̲͕̯̫=ʾʹ̷̵̴̸̨̧̨̣͇̼̗͕͓̼̺̪̄͐̐ͣ̅ͭ̿̈́̽̕̕͢+ⵗہ̴̸̡̤͇͓̱̫̞̠̖ͣͦ̏ͭ̎ͯͬ͂͒̀͟͟͡͝ͅ+ᱺꜘ̶̵̨̨̢̦̟̻̖͇̳̠̱̮̟͛̐ͭ̀ͤ̈́ͨͨ͒́͟͜͡͞,ᖕγ̾ͯͭͧͣ̊̉ͤͦͨ̚̕̕͢͝͡͏̡̛̞̹̭͖̜͔̜͓̙́́͜=ᱺꜘ̶̵̨̨̢̦̟̻̖͇̳̠̱̮̟͛̐ͭ̀ͤ̈́ͨͨ͒́͟͜͡͞+ⵗہ̴̸̡̤͇͓̱̫̞̠̖ͣͦ̏ͭ̎ͯͬ͂͒̀͟͟͡͝ͅ+ᒻˇ̷̵̶̢̨̛̼̻͈̮̪̯͖͕̜̘ͩ͊͒ͮ̅́̐͊ͥ̍̊͘͘̕͝͞ͅ+ﾞ8̶̸̧̧̡̯̘͍͎̫͚̺̳͖ͥͦ̿̈͊̍͛̂͊́͘͢͜͞ͅ,ꓺᵔ̡ͮͩ͗̔̈̌͛̿͛͗͏̵̨̛̹͔̺̣̭̘̰͍͉͉̀̕͠͝ͅ=ᱺꜘ̶̵̨̨̢̦̟̻̖͇̳̠̱̮̟͛̐ͭ̀ͤ̈́ͨͨ͒́͟͜͡͞+ⵗہ̴̸̡̤͇͓̱̫̞̠̖ͣͦ̏ͭ̎ͯͬ͂͒̀͟͟͡͝ͅ+ᔉꙿ̷̡̨̦̹̮̫̜̪̖͙ͫ͗̃͒̿̎̏̍̎́͢͠͞͝͞,ᠹͺ̵̶̴̸̵̨̡̠͉͇̬̭̤̬̦̯̘̊ͪ͆ͭ͌ͯ͗͒͑̄̕̕̕͢=ﾞ8̶̸̧̧̡̯̘͍͎̫͚̺̳͖ͥͦ̿̈͊̍͛̂͊́͘͢͜͞ͅ+ᒻˇ̷̵̶̢̨̛̼̻͈̮̪̯͖͕̜̘ͩ͊͒ͮ̅́̐͊ͥ̍̊͘͘̕͝͞ͅ,ᠥh̴̷̵̡͎̯̱̻̫̣̱̘̖̥͚̓ͧ̿̄̉̍́̆̅̀́̚͘̕͢͠͞=ʾʹ̷̵̴̸̨̧̨̣͇̼̗͕͓̼̺̪̄͐̐ͣ̅ͭ̿̈́̽̕̕͢+ﾞ8̶̸̧̧̡̯̘͍͎̫͚̺̳͖ͥͦ̿̈͊̍͛̂͊́͘͢͜͞ͅ+ᱺꜘ̶̵̨̨̢̦̟̻̖͇̳̠̱̮̟͛̐ͭ̀ͤ̈́ͨͨ͒́͟͜͡͞,ㆍʿ̵̨̛̩͓͉̞̭̱̯̮͉̺̍͆ͥ̀̓̂̅ͯ́̀̀̕̕͜͞=ʾʹ̷̵̴̸̨̧̨̣͇̼̗͕͓̼̺̪̄͐̐ͣ̅ͭ̿̈́̽̕̕͢+ᒻˇ̷̵̶̢̨̛̼̻͈̮̪̯͖͕̜̘ͩ͊͒ͮ̅́̐͊ͥ̍̊͘͘̕͝͞ͅ+ᓒˌ̨̢͋ͮ̆ͭ́ͯ̈̑̔͆ͣ͠͏̴̢͏̖̳̜͇̺͙̻̹̫̤̀ͅ,ᠧہ̸̧̧̛̖̘̥̪̬̲̗̳̱͎͎͊̒̂̐̇̐͆̑́̕͘͟͜͟=ﾞ8̶̸̧̧̡̯̘͍͎̫͚̺̳͖ͥͦ̿̈͊̍͛̂͊́͘͢͜͞ͅ+ⵗہ̴̸̡̤͇͓̱̫̞̠̖ͣͦ̏ͭ̎ͯͬ͂͒̀͟͟͡͝ͅ+ᒻˇ̷̵̶̢̨̛̼̻͈̮̪̯͖͕̜̘ͩ͊͒ͮ̅́̐͊ͥ̍̊͘͘̕͝͞ͅ+ᓒˌ̨̢͋ͮ̆ͭ́ͯ̈̑̔͆ͣ͠͏̴̢͏̖̳̜͇̺͙̻̹̫̤̀ͅ+ᱺꜘ̶̵̨̨̢̦̟̻̖͇̳̠̱̮̟͛̐ͭ̀ͤ̈́ͨͨ͒́͟͜͡͞+ᔉꙿ̷̡̨̦̹̮̫̜̪̖͙ͫ͗̃͒̿̎̏̍̎́͢͠͞͝͞,ᠩꜙ̶̨̢̳̮̩̻͖̲̼̝̰͙̞̑̉̄ͥ͗ͤͯͣ͆̕͜͞͞͞͡=ᒻˇ̷̵̶̢̨̛̼̻͈̮̪̯͖͕̜̘ͩ͊͒ͮ̅́̐͊ͥ̍̊͘͘̕͝͞ͅ+ⵗہ̴̸̡̤͇͓̱̫̞̠̖ͣͦ̏ͭ̎ͯͬ͂͒̀͟͟͡͝ͅ+ᔉꙿ̷̡̨̦̹̮̫̜̪̖͙ͫ͗̃͒̿̎̏̍̎́͢͠͞͝͞+ʾʹ̷̵̴̸̨̧̨̣͇̼̗͕͓̼̺̪̄͐̐ͣ̅ͭ̿̈́̽̕̕͢,ᱺˌ̵̸̧̢̨̬͔͈̠͍̫͚͕͚͋͂͑ͪ̈̏̇̏ͯ̈́̌́̕͟͢͠=ᓒˌ̨̢͋ͮ̆ͭ́ͯ̈̑̔͆ͣ͠͏̴̢͏̖̳̜͇̺͙̻̹̫̤̀ͅ+ᱺꜘ̶̵̨̨̢̦̟̻̖͇̳̠̱̮̟͛̐ͭ̀ͤ̈́ͨͨ͒́͟͜͡͞,γꜗ̸̵̸̶̵͓̭͉̮͇͕̹͉̟̬͆͋̾̀͆ͣ̒ͨ́͜͟͜=ᒻˇ̷̵̶̢̨̛̼̻͈̮̪̯͖͕̜̘ͩ͊͒ͮ̅́̐͊ͥ̍̊͘͘̕͝͞ͅ+ᔉꙿ̷̡̨̦̹̮̫̜̪̖͙ͫ͗̃͒̿̎̏̍̎́͢͠͞͝͞+ⵗہ̴̸̡̤͇͓̱̫̞̠̖ͣͦ̏ͭ̎ͯͬ͂͒̀͟͟͡͝ͅ+ᱺꜘ̶̵̨̨̢̦̟̻̖͇̳̠̱̮̟͛̐ͭ̀ͤ̈́ͨͨ͒́͟͜͡͞,ㆴoิʹ̷̨̣͔̮̜̹̦̝̻͓͈̞̀̅͒̈͂͌̀̀̚̕͘͜͟͠=ⵗہ̴̸̡̤͇͓̱̫̞̠̖ͣͦ̏ͭ̎ͯͬ͂͒̀͟͟͡͝ͅ+ʾʹ̷̵̴̸̨̧̨̣͇̼̗͕͓̼̺̪̄͐̐ͣ̅ͭ̿̈́̽̕̕͢+ᒻˇ̷̵̶̢̨̛̼̻͈̮̪̯͖͕̜̘ͩ͊͒ͮ̅́̐͊ͥ̍̊͘͘̕͝͞ͅ+ﾞ8̶̸̧̧̡̯̘͍͎̫͚̺̳͖ͥͦ̿̈͊̍͛̂͊́͘͢͜͞ͅ+ᱺꜘ̶̵̨̨̢̦̟̻̖͇̳̠̱̮̟͛̐ͭ̀ͤ̈́ͨͨ͒́͟͜͡͞,ٴʹ̷̷͂̔̍̽ͫ̋̎ͭ͗ͥ̀̕͘̕͜͠͝͠͏̟̗͚͙͖͇̪̜͔̫='ㆵʿ͆ͫmܰᠰˈ͌'[ⵗہ̴̸̡̤͇͓̱̫̞̠̖ͣͦ̏ͭ̎ͯͬ͂͒̀͟͟͡͝ͅ],މr̷̷̨͔͉̱̲͎̭̦̩̺͗͒̎ͭ͆͗̎̐͗͟͞͝͝͞='ޙʾ͂h۠'[ﾞ8̶̸̧̧̡̯̘͍͎̫͚̺̳͖ͥͦ̿̈͊̍͛̂͊́͘͢͜͞ͅ+ᓒˌ̨̢͋ͮ̆ͭ́ͯ̈̑̔͆ͣ͠͏̴̢͏̖̳̜͇̺͙̻̹̫̤̀ͅ],יᶥ̛͗̃ͪ̋̑ͨ͗ͣ̈́̎ͪ͏̛̛͢͏̷̡͘͜͏͈͈̘̺̹̣͇̮=ᔉꙿ̷̡̨̦̹̮̫̜̪̖͙ͫ͗̃͒̿̎̏̍̎́͢͠͞͝͞+ᱺꜘ̶̵̨̨̢̦̟̻̖͇̳̠̱̮̟͛̐ͭ̀ͤ̈́ͨͨ͒́͟͜͡͞+ⵗہ̴̸̡̤͇͓̱̫̞̠̖ͣͦ̏ͭ̎ͯͬ͂͒̀͟͟͡͝ͅ+ʾʹ̷̵̴̸̨̧̨̣͇̼̗͕͓̼̺̪̄͐̐ͣ̅ͭ̿̈́̽̕̕͢+ﾞ8̶̸̧̧̡̯̘͍͎̫͚̺̳͖ͥͦ̿̈͊̍͛̂͊́͘͢͜͞ͅ,ᐞꜗ̵̵̢̛̥̺̝͓̰̣̯̘̳̯͌̆ͭͨ̄̇̃́̚͜͜͞=ʾʹ̷̵̴̸̨̧̨̣͇̼̗͕͓̼̺̪̄͐̐ͣ̅ͭ̿̈́̽̕̕͢+ᔉꙿ̷̡̨̦̹̮̫̜̪̖͙ͫ͗̃͒̿̎̏̍̎́͢͠͞͝͞+ᒻˇ̷̵̶̢̨̛̼̻͈̮̪̯͖͕̜̘ͩ͊͒ͮ̅́̐͊ͥ̍̊͘͘̕͝͞ͅ+ﾞ8̶̸̧̧̡̯̘͍͎̫͚̺̳͖ͥͦ̿̈͊̍͛̂͊́͘͢͜͞ͅ,ᠩᵔ̷̵̸̡̡̜̻̗͕̻̮̩̬̯̬̈ͮ͑͐̆͑͐͌͌́͘͟͞͞͝=ᒻˇ̷̵̶̢̨̛̼̻͈̮̪̯͖͕̜̘ͩ͊͒ͮ̅́̐͊ͥ̍̊͘͘̕͝͞ͅ+ᔉꙿ̷̡̨̦̹̮̫̜̪̖͙ͫ͗̃͒̿̎̏̍̎́͢͠͞͝͞,ᶥᵔ̧̛͋͌̂̓̃̎̃̋͟͏̨͏͖̣͎̫͖͚̜͇̜͘͡=ⵗہ̴̸̡̤͇͓̱̫̞̠̖ͣͦ̏ͭ̎ͯͬ͂͒̀͟͟͡͝ͅ+ᒻˇ̷̵̶̢̨̛̼̻͈̮̪̯͖͕̜̘ͩ͊͒ͮ̅́̐͊ͥ̍̊͘͘̕͝͞ͅ+ʾʹ̷̵̴̸̨̧̨̣͇̼̗͕͓̼̺̪̄͐̐ͣ̅ͭ̿̈́̽̕̕͢+ᔉꙿ̷̡̨̦̹̮̫̜̪̖͙ͫ͗̃͒̿̎̏̍̎́͢͠͞͝͞+ﾞ8̶̸̧̧̡̯̘͍͎̫͚̺̳͖ͥͦ̿̈͊̍͛̂͊́͘͢͜͞ͅ+ᓒˌ̨̢͋ͮ̆ͭ́ͯ̈̑̔͆ͣ͠͏̴̢͏̖̳̜͇̺͙̻̹̫̤̀ͅ,ꓼء̵̨̢͔̫̳̗͔̳͚̯̦͊͋̊ͤ̍̅͑ͤ̌́̚͘͜͟͠͝ͅ=ﾞ8̶̸̧̧̡̯̘͍͎̫͚̺̳͖ͥͦ̿̈͊̍͛̂͊́͘͢͜͞ͅ+ʾʹ̷̵̴̸̨̧̨̣͇̼̗͕͓̼̺̪̄͐̐ͣ̅ͭ̿̈́̽̕̕͢+ᱺꜘ̶̵̨̨̢̦̟̻̖͇̳̠̱̮̟͛̐ͭ̀ͤ̈́ͨͨ͒́͟͜͡͞+ᓒˌ̨̢͋ͮ̆ͭ́ͯ̈̑̔͆ͣ͠͏̴̢͏̖̳̜͇̺͙̻̹̫̤̀ͅ,ᠤγ͒ͤ͑̋ͣ̒ͦ̎͜͏̧̧̟̪͈͕͕̻̫̞̥͚̀̕͟͡͝=ﾞ8̶̸̧̧̡̯̘͍͎̫͚̺̳͖ͥͦ̿̈͊̍͛̂͊́͘͢͜͞ͅ+ʾʹ̷̵̴̸̨̧̨̣͇̼̗͕͓̼̺̪̄͐̐ͣ̅ͭ̿̈́̽̕̕͢+ᒻˇ̷̵̶̢̨̛̼̻͈̮̪̯͖͕̜̘ͩ͊͒ͮ̅́̐͊ͥ̍̊͘͘̕͝͞ͅ+ᓒˌ̨̢͋ͮ̆ͭ́ͯ̈̑̔͆ͣ͠͏̴̢͏̖̳̜͇̺͙̻̹̫̤̀ͅ,ꓸۀ̸̸̷̨̖̘̯̮͓̙̱̦̅̈̏ͫ̂ͭͭ̐͐̀̕͜͝͞='ㆴꓸ̂̐̋͒̎n࣭'[ⵗہ̴̸̡̤͇͓̱̫̞̠̖ͣͦ̏ͭ̎ͯͬ͂͒̀͟͟͡͝ͅ+ᓒˌ̨̢͋ͮ̆ͭ́ͯ̈̑̔͆ͣ͠͏̴̢͏̖̳̜͇̺͙̻̹̫̤̀ͅ+ﾞ8̶̸̧̧̡̯̘͍͎̫͚̺̳͖ͥͦ̿̈͊̍͛̂͊́͘͢͜͞ͅ],ᖮꜚ̅̍ͦ̔̅͂͛̍̆̊͝͏́͝͏̵̸̛͏̩͙̺͙̖̦͇̰̲̺̙́='fླᔾꜙ̋'[ᠱγ̵͊̓̎̓ͥ͛͐̇ͥ̈̕͏̶̷̵̧̨͍̫͕̜̫͉̮͔̬̦̙͜͡],ᛍᵕ̛ͬ͐̒̂͗̓̌̃ͤ͏̶̵̡̧̡̛͘͢͏̺̲̘͍͈͚̞͈̬=ᱺꜘ̶̵̨̨̢̦̟̻̖͇̳̠̱̮̟͛̐ͭ̀ͤ̈́ͨͨ͒́͟͜͡͞+ᒻˇ̷̵̶̢̨̛̼̻͈̮̪̯͖͕̜̘ͩ͊͒ͮ̅́̐͊ͥ̍̊͘͘̕͝͞ͅ+ʾʹ̷̵̴̸̨̧̨̣͇̼̗͕͓̼̺̪̄͐̐ͣ̅ͭ̿̈́̽̕̕͢,ߑٴ̷̧ͮ͊̍̔ͫ̆͌͊̽̕͠͏̴̡̪͙̩̜̫̜̖͎͉͕͢͝=ⵗہ̴̸̡̤͇͓̱̫̞̠̖ͣͦ̏ͭ̎ͯͬ͂͒̀͟͟͡͝ͅ+ᓒˌ̨̢͋ͮ̆ͭ́ͯ̈̑̔͆ͣ͠͏̴̢͏̖̳̜͇̺͙̻̹̫̤̀ͅ+ʾʹ̷̵̴̸̨̧̨̣͇̼̗͕͓̼̺̪̄͐̐ͣ̅ͭ̿̈́̽̕̕͢+ᱺꜘ̶̵̨̨̢̦̟̻̖͇̳̠̱̮̟͛̐ͭ̀ͤ̈́ͨͨ͒́͟͜͡͞,ޚʽ̉̃̇͒ͭ̔͊͊́ͨͨ͏̵̵̷̸̢̞͎̤̞̭̣̝̯̀͠=ʾʹ̷̵̴̸̨̧̨̣͇̼̗͕͓̼̺̪̄͐̐ͣ̅ͭ̿̈́̽̕̕͢+ᒻˇ̷̵̶̢̨̛̼̻͈̮̪̯͖͕̜̘ͩ͊͒ͮ̅́̐͊ͥ̍̊͘͘̕͝͞ͅ+ﾞ8̶̸̧̧̡̯̘͍͎̫͚̺̳͖ͥͦ̿̈͊̍͛̂͊́͘͢͜͞ͅ+ᓒˌ̨̢͋ͮ̆ͭ́ͯ̈̑̔͆ͣ͠͏̴̢͏̖̳̜͇̺͙̻̹̫̤̀ͅ+ᱺꜘ̶̵̨̨̢̦̟̻̖͇̳̠̱̮̟͛̐ͭ̀ͤ̈́ͨͨ͒́͟͜͡͞+ᔉꙿ̷̡̨̦̹̮̫̜̪̖͙ͫ͗̃͒̿̎̏̍̎́͢͠͞͝͞,ʽG̴̶̨̡̯̯̩͇̞̤̗͚̥̺̍̋̍ͤ̉͑͗ͫ͌́͗́̕͟͡͡=ⵗہ̴̸̡̤͇͓̱̫̞̠̖ͣͦ̏ͭ̎ͯͬ͂͒̀͟͟͡͝ͅ+ᱺꜘ̶̵̨̨̢̦̟̻̖͇̳̠̱̮̟͛̐ͭ̀ͤ̈́ͨͨ͒́͟͜͡͞+ﾞ8̶̸̧̧̡̯̘͍͎̫͚̺̳͖ͥͦ̿̈͊̍͛̂͊́͘͢͜͞ͅ,ᚑʺ̴̵̶̲̙̫̼̣̣͉͚͚̀̈́̒ͤͥ̑̿͊ͥ̈̕̕͟͜͞='ᚐᵔͩͩ̂̅Cຸᓒʿͩ̎'[ⵗہ̴̸̡̤͇͓̱̫̞̠̖ͣͦ̏ͭ̎ͯͬ͂͒̀͟͟͡͝ͅ+ᓒˌ̨̢͋ͮ̆ͭ́ͯ̈̑̔͆ͣ͠͏̴̢͏̖̳̜͇̺͙̻̹̫̤̀ͅ],ᒼՙ̵̛ͭ̀͒ͨͧ͗̀ͭ̋͛̎͜͟͏͉̠͕͚͈̝̯̜̕͟͡=ﾞ8̶̧̧̡ͥͦ̿̈͊̍͛̂͊́͘͢͜͞
